import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Nav.css';
const logo = {
   id:"https://art.pixilart.com/7e3057713456a9d.png" 
    }
class Nav extends Component {
    state = {  }
    
    render() { 
        return (
            <div >
                <nav>
                    <img src=
                    {logo.id} class="logo"></img>
                    <Link to="/">
                    <li>Home</li>
                    </Link >

                    <Link to="/Tracker">
                    <li>Tracker</li>
                    </Link>
                    
                    <Link>
                    <li><a></a>Resources</li>
                    </Link>

                    <Link>
                    <li>About</li>
                    </Link>

                </nav>
            </div>
          );
    }
}

export default Nav;
